import React from 'react';
import LargeButton from '../components/LargeButton';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div className='absolute top-1/3 flex flex-col gap-x-10 px-10 w-40px'>
            <Link to={'/skills'} className='flex-1'>
                <LargeButton
                    colour='blue'
                    label="Skills & Education"
                    desc="Coding languages, technologies, and educational accomplishments"
                />
            </Link>
            <Link to={'/projects'} className='flex-1'>
                <LargeButton
                    colour='yellow'
                    label="Projects & Experience"
                    desc="Exhibit of personal projects and work experiences"
                />
            </Link>
        </div>
    );
};

export default Home;
